var CORSAIR_COMMAND_WRITE       = 0x07;
var CORSAIR_COMMAND_READ        = 0x0E;
var CORSAIR_COMMAND_STREAM      = 0x7F;
var CORSAIR_PROPERTY_LIGHTING_CONTROL           = 0x05;
var CORSAIR_LIGHTING_CONTROL_HARDWARE           = 0x01;
var CORSAIR_LIGHTING_CONTROL_SOFTWARE           = 0x02;
var CORSAIR_PROPERTY_SUBMIT_KEYBOARD_COLOR_24   = 0x28;
var CORSAIR_PROPERTY_SPECIAL_FUNCTION = 0x04;
var CORSAIR_PROPERTY_SUBMIT_MOUSE_COLOR         = 0x22;

var brightness = .5;

export function Initialize()
{
    
    var packet = [];

    packet[0x00]           = 0x00;
    packet[0x01]           = 0x38;
    packet[0x02]           = 0x00;    //Channel 0/1
    packet[0x03]           = CORSAIR_LIGHTING_CONTROL_SOFTWARE;
 
    device.write(packet, 65);
}


export function Shutdown()
{
    // Return to some BS here?  Solid color?
    var packet = [];
    packet[0x00] = 0x00;
    packet[0x01] = 0x38;
    packet[0x02] = 0x00;
    packet[0x03] = 0x01;
    device.write(packet, 65);
    
}

function StreamLightingPacket(start, count, colorChannel, data)
{
    //channel selection == 32 0/1 Start Count Channel LEDS
    //(Start, Count, Color, Data)
    var packet = [];
    packet[0x00]   = 0x00;
    packet[0x01]   = 0x32;
    packet[0x02]   = 0x00;
    packet[0x03]   = start;
    packet[0x04]   = count;
    packet[0x05]   = colorChannel;
    packet = packet.concat(data);
    device.write(packet, 65);
}

function channelStart(channel){
    var packet = [];
    //start packet == 34 00 channel (len 64)
    packet[0x00]   = 0x00;
    packet[0x01]   = 0x34;
    packet[0x02]   = channel;
    device.write(packet, 65);
}

function SubmitLightingColors()
{
    var packet = [];
    //commit packet == 32 FF (len 64)
    packet[0x00]   = 0x00;
    packet[0x01]   = 0x33;
    packet[0x02]   = 0xFF;
    device.write(packet, 65);
}
